fields.description:
Ременной компрессор Gigant BCL-100 предназначен для подачи воздуха в пневмоинструмент. Широко используется в автомастерских, а так же строительных и производственных площадках.

Данная модель имеет широкую ручку на корпусе и колеса для удобной транспортировки.

Материалы:

Цилиндр: чугун;
Поршень: алюминиевый сплав;
Голова: алюминиевый сплав;
Трубки: алюминий;
Обмотка асинхронного двигателя: алюминий.
